import { createRouter, createWebHistory } from 'vue-router';
import ShippingCompanyTable from './components/ShippingCompanyTable.vue';
import BalanceInquiry from './components/BalanceInquiry.vue';

const routes = [
  {
    path: '/',
    name: 'ShippingCompanyTable',
    component: ShippingCompanyTable,
  },
  {
    path: '/BalanceInquiry',
    name: 'BalanceInquiry',
    component: BalanceInquiry,
  },
]

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
